import React, { useState, useEffect } from 'react';
import { format, startOfWeek, addDays } from 'date-fns';
import { supabase } from '../utils/supabaseClient';
import '../styles/main.css';

interface Event {
  id: string;
  title: string;
  date: string;
  type: 'event' | 'outfit';
}

interface WeatherData {
  date: string;
  temperature: number;
  condition: string;
}

interface PlannedOutfit {
  id: string;
  name: string;
  date: string;
  items: string[];
}

const Calendar: React.FC = () => {
  const [events, setEvents] = useState<Event[]>([]);
  const [weatherData, setWeatherData] = useState<WeatherData[]>([]);
  const [plannedOutfits, setPlannedOutfits] = useState<PlannedOutfit[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchEvents();
    fetchWeatherData();
    fetchPlannedOutfits();
  }, []);

  const fetchEvents = async () => {
    try {
      const { data, error } = await supabase
        .from('events')
        .select('*')
        .gte('date', format(startOfWeek(new Date()), 'yyyy-MM-dd'))
        .lte('date', format(addDays(startOfWeek(new Date()), 6), 'yyyy-MM-dd'));

      if (error) throw error;
      if (data) setEvents(data);
    } catch (error) {
      console.error('Error fetching events:', error);
    }
  };

  const fetchWeatherData = async () => {
    try {
      // This would typically call a weather API
      // For now, we'll use mock data
      const mockWeatherData: WeatherData[] = Array.from({ length: 7 }, (_, i) => ({
        date: format(addDays(startOfWeek(new Date()), i), 'yyyy-MM-dd'),
        temperature: Math.floor(Math.random() * 20) + 10,
        condition: ['sunny', 'cloudy', 'rainy'][Math.floor(Math.random() * 3)],
      }));
      setWeatherData(mockWeatherData);
    } catch (error) {
      console.error('Error fetching weather data:', error);
    }
  };

  const fetchPlannedOutfits = async () => {
    try {
      const { data, error } = await supabase
        .from('planned_outfits')
        .select('*')
        .gte('date', format(startOfWeek(new Date()), 'yyyy-MM-dd'))
        .lte('date', format(addDays(startOfWeek(new Date()), 6), 'yyyy-MM-dd'));

      if (error) throw error;
      if (data) setPlannedOutfits(data);
    } catch (error) {
      console.error('Error fetching planned outfits:', error);
    } finally {
      setLoading(false);
    }
  };

  const getDayCards = () => {
    const startDate = startOfWeek(new Date());
    return Array.from({ length: 7 }, (_, i) => {
      const date = addDays(startDate, i);
      const dateStr = format(date, 'yyyy-MM-dd');
      const dayEvents = events.filter(event => event.date === dateStr);
      const dayOutfit = plannedOutfits.find(outfit => outfit.date === dateStr);
      const dayWeather = weatherData.find(weather => weather.date === dateStr);

      return (
        <div key={dateStr} className="card">
          <div style={{ fontFamily: 'serif', fontSize: '1.125rem', marginBottom: '0.5rem' }}>
            {format(date, 'EEEE')}
            <span style={{ color: '#4b5563', marginLeft: '0.5rem' }}>{format(date, 'MMM d')}</span>
          </div>

          {dayWeather && (
            <div style={{ fontSize: '0.875rem', color: '#4b5563', marginBottom: '0.5rem' }}>
              {dayWeather.temperature}°C - {dayWeather.condition}
            </div>
          )}

          {dayEvents.map(event => (
            <div
              key={event.id}
              style={{
                backgroundColor: '#f3f4f6',
                padding: '0.5rem',
                borderRadius: '0.25rem',
                marginBottom: '0.5rem',
                fontSize: '0.875rem',
              }}
            >
              {event.title}
            </div>
          ))}

          {dayOutfit ? (
            <div style={{ marginTop: '0.5rem' }}>
              <p style={{ fontSize: '0.875rem', fontWeight: 500 }}>Planned Outfit:</p>
              {/* Outfit preview would go here */}
            </div>
          ) : (
            <button style={{ marginTop: '0.5rem', fontSize: '0.875rem', color: '#4b5563' }}>
              Plan outfit
            </button>
          )}
        </div>
      );
    });
  };

  if (loading) {
    return (
      <div className="dashboard">
        <h1 className="dashboard-title">Calendar</h1>
        <div style={{ color: '#4b5563' }}>Loading...</div>
      </div>
    );
  }

  return (
    <div className="dashboard">
      <h1 className="dashboard-title">Calendar</h1>

      {events.length === 0 && (
        <div style={{ backgroundColor: '#f3f4f6', padding: '1rem', borderRadius: '0.5rem', marginBottom: '2rem' }}>
          <p style={{ color: '#4b5563' }}>
            No scheduled events this week. Feel free to dress as you wish or check out the Outfit Generator page!
          </p>
        </div>
      )}

      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '1rem' }}>
        {getDayCards()}
      </div>
    </div>
  );
};

export default Calendar;
